INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('ard_regressor', (select id from ml_task_type where name='regression'),'The Automatic Relevance Determination (ARD) model is a Bayesian linear regression model from the scikit-learn library that extends the traditional linear regression model by incorporating priors on the model parameters. It aims to estimate the relevance of each input feature by learning individual regularization parameters for each feature. This results in a form of automatic feature selection, as irrelevant or redundant features are assigned larger regularization parameters, effectively reducing their impact on the model''s predictions. The ARD model uses an iterative optimization process to estimate both the model parameters and the hyperparameters associated with the priors. This Bayesian approach allows the model to quantify the uncertainty in its predictions, providing a measure of confidence alongside the predicted values. The ARD model is particularly useful for regression tasks with high-dimensional data, where the underlying structure of the data is unknown, and automatic feature selection or sparsity is desired.', 'Automatic Relevance Determination Regressor', (select id from model_structure_type where name='base'), '{Automatically selects regularization parameters.,Identifies the most relevant features for the regression task.,Can handle multicollinearity in the input features.,Reduces model complexity by pruning less important features.}', '{Sensitive to the choice of hyperparameters.,May require more iterations to converge compared to other linear regression models.,Not suitable for very large datasets due to computational complexity.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from model_type where name='Bayesian Model'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('alpha_1', 'Alpha 1', 'Shape parameter for the Gamma distribution prior over the alpha parameter, which influences the strength of the regularization.', true, false, 1, (select id from Model where name='ard_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('alpha_2', 'Alpha 2', 'Inverse scale parameter (rate parameter) for the Gamma distribution prior over the alpha parameter, which affects the distribution''s shape and scale.', true, false, 2, (select id from Model where name='ard_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Indicates whether to calculate the intercept for this model. If set to False, the data is expected to be centered and no intercept will be used in calculations.', false, false, 3, (select id from Model where name='ard_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('lambda_1', 'Lambda 1', 'Shape parameter for the Gamma distribution prior over the lambda parameter, which influences the strength of the regularization for each feature''s weight.', true, false, 4, (select id from Model where name='ard_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('lambda_2', 'Lambda 2', 'Inverse scale parameter (rate parameter) for the Gamma distribution prior over the lambda parameter, which affects the distribution''s shape and scale for each feature''s weight.', true, false, 5, (select id from Model where name='ard_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_iter', 'Number of iterations', 'Maximum number of iterations for the model to converge.', false, false, 6, (select id from Model where name='ard_regressor'));
