INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('elastic_net_regressor', (select id from ml_task_type where name='regression'),'The Elastic Net Regressor is a linear regression model that combines the strengths of both Lasso and Ridge regression techniques. By incorporating both L1 and L2 regularization terms, it provides a balanced approach to penalize coefficients, enabling the model to prevent overfitting while dealing effectively with correlated features. It is particularly useful when there are many correlated variables in the dataset, as it tends to distribute feature importance relatively equally among correlated variables while also performing feature selection.', 'Elastic Net Regressor', (select id from model_structure_type where name='base'), '{Versatility in Handling Correlated Features: Elastic Net can effectively manage correlated features by blending L1 and L2 regularizations. This provides a balanced approach that tends to distribute the weight of importance among correlated variables.,Prevents Overfitting While Enabling Feature Selection: Unlike Ridge regression, which can''t set coefficients to zero, or Lasso, which can be inconsistent in high-dimensional spaces, Elastic Net brings the best of both worlds. It helps to prevent overfitting and, at the same time, can shrink less important features'' coefficients to zero, performing automatic feature selection.,Stability and Uniqueness: Elastic Net provides model stability under conditions where Lasso would produce multiple solutions due to highly correlated predictors. The Ridge component of Elastic Net ensures that a unique solution exists, which aids in model interpretability and consistency.}', '{Computational Complexity: Elastic Net requires the tuning of two hyperparameters, which increases computational time and complexity. This can make grid search or other hyperparameter tuning methods more time-consuming compared to simpler models.,Reduced Interpretability: While still more interpretable than many non-linear models, the inclusion of both L1 and L2 regularizations makes Elastic Net somewhat harder to interpret than standard Linear Regression.,Sensitivity to Scaling: Elastic Net is sensitive to the scale of input features. Feature scaling is usually required to ensure that the regularization treats all features equally, adding an extra preprocessing step.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from model_type where name='Linear Model'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='elastic_net_regressor'),(select id from model_group_type where name='explainable'));
