INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Whether to calculate the intercept for this model. If set to False, no intercept will be used in calculations (i.e. data is expected to be centered).', false, false, 2, (select id from Model where name='elastic_net_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('l1_ratio', 'L1 ratio', 'The Elastic-Net mixing parameter, with 0 <= l1_ratio <= 1.', true, false, 3, (select id from Model where name='elastic_net_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', '    Maximum number of iterations taken for the solvers to converge.', true, false, 4, (select id from Model where name='elastic_net_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('positive', 'Positive', 'When set to True, forces the coefficients to be positive.', false, false, 5, (select id from Model where name='elastic_net_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('selection', 'Selection', 'If set to ''random'', a random coefficient is updated every iteration rather than looping over features sequentially by default. This (setting to ''random'') often leads to significantly faster convergence especially when tol is higher than 1e-4.', false, false, 6, (select id from Model where name='elastic_net_regressor'));
