INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('lasso_regressor', (select id from ml_task_type where name='regression'),'The Lasso Regressor is a linear regression model that employs L1 regularization to add a penalty term to the loss function, which is proportional to the absolute value of the coefficients. This form of regularization encourages sparsity by forcing some coefficients to be exactly zero, effectively performing feature selection. Lasso is particularly useful when you suspect that many features are irrelevant or redundant, and you want a model that is easier to interpret.', 'Lasso Regressor', (select id from model_structure_type where name='base'), '{Feature Selection: One of the key advantages of Lasso Regression is its ability to perform automatic feature selection. By forcing some coefficient estimates to be exactly zero, it provides a model that involves only a subset of the features, making the model easier to interpret and generalize.,Prevention of Overfitting: Similar to Ridge and Elastic Net, Lasso also adds a penalty term to the loss function, discouraging overly complex models and thus helping to prevent overfitting.,Works Well with High-Dimensional Data: Lasso Regression can provide good performance even when the number of features is greater than the number of samples, especially when only a subset of the features is relevant for prediction.}', '{Stability Issues: Lasso can be unstable in cases where predictors are highly correlated. In such cases, it may arbitrarily choose one feature over another, which may vary with slight changes in the data.,Hyperparameter Tuning: Just like Ridge and Elastic Net, Lasso also requires the tuning of a regularization strength hyperparameter, which can add to the complexity and computational time needed for model development.,Limitation in Model Complexity: By zeroing out some of the coefficients, Lasso may produce a model that is too simplistic to capture the underlying patterns in the data, especially if the true relationship requires inclusion of all features.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='other'), false, (select id from model_type where name='Linear Model'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('alpha', 'Alpha', 'Constant that multiplies the L1 term, controlling regularization strength. ', true, false, 1, (select id from Model where name='lasso_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Whether to calculate the intercept for this model. If set to False, no intercept will be used in calculations (i.e. data is expected to be centered).', false, false, 2, (select id from Model where name='lasso_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', '    Maximum number of iterations taken for the solvers to converge.', true, false, 3, (select id from Model where name='lasso_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('positive', 'Positive', 'When set to True, forces the coefficients to be positive.', false, false, 4, (select id from Model where name='lasso_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('selection', 'Selection', 'If set to ''random'', a random coefficient is updated every iteration rather than looping over features sequentially by default. This (setting to ''random'') often leads to significantly faster convergence especially when tol is higher than 1e-4.', false, false, 5, (select id from Model where name='lasso_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Maximum norm of the residual.', true, false, 6, (select id from Model where name='lasso_regressor'));
