INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('linear_regressor', (select id from ml_task_type where name='regression'),'The Linear Regressor is a fundamental statistical model that aims to establish a linear relationship between a set of input features and a continuous output variable. It is simple, interpretable, and computationally efficient, making it a good baseline model for many predictive tasks. The method seeks to fit a linear equation to observed data by minimizing the sum of the squared differences between the observed outcomes and the outcomes predicted by the model.', 'Linear Regressor', (select id from model_structure_type where name='base'), '{Interpretability: One of the main advantages of Linear Regression is its high interpretability. The coefficients of the model directly indicate the impact of each feature on the target variable, making it easy to explain the model''s decisions.,Low Computational Cost: Linear Regression is computationally inexpensive to train and predict, making it highly scalable for datasets with a large number of samples and features.,Fast to Implement and Train: Due to its simplicity and the availability of analytical solutions, a Linear Regressor can be quickly implemented and trained, serving as a useful baseline model in many machine learning projects.}', '{Prone to Overfitting with High-Dimensional Data: In cases where the number of features is greater than the number of observations, or when features are highly correlated, Linear Regression is susceptible to overfitting.,Assumes Linear Relationship: Linear Regression assumes that the relationship between the features and the target variable is linear. This assumption may not hold for complex, real-world data sets where relationships can be non-linear.,Sensitive to Outliers: The model is sensitive to outliers in the data, which can disproportionately affect the slope of the regression line and, consequently, the predictions.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from model_type where name='Linear Model'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='linear_regressor'),(select id from model_group_type where name='fast'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='linear_regressor'),(select id from model_group_type where name='explainable'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Determines whether to include an intercept term in the linear regression model. If set to True, the model will calculate the intercept; if set to False, the model assumes that the data is centered and will not use an intercept in calculations.', true, false, 1, (select id from Model where name='linear_regressor'));
