INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('linearsvr_regressor', (select id from ml_task_type where name='regression'),'Linear Support Vector Machine Regressor is similar to Support Vector Machine Regressor with the linear kernel but has more flexibility in the choice of penalties and loss functions.', 'Linear Support Vector Machine Regressor', (select id from model_structure_type where name='base'), '{It performs well in higher dimension spaces,It is robust to outliers}', '{It is computationally expensive,It is tricky in selecting the appropriate kernel function}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='other'), false, (select id from model_type where name='Kernel Model'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('C', 'C', 'Inverse of regularization strength; must be a positive float. Like in support vector machines, smaller values specify stronger regularization.', true, false, 1, (select id from Model where name='linearsvr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('dual', 'Dual', 'Select the algorithm to either solve the dual or primal optimization problem. Prefer dual=False when n_samples > n_features.', false, false, 2, (select id from Model where name='linearsvr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('epsilon', 'Epsilon', 'Value for numerical stability in adam. Only used when solver=''adam''.', false, false, 3, (select id from Model where name='linearsvr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Whether to calculate the intercept for this model. If set to False, no intercept will be used in calculations (i.e. data is expected to be centered).', false, false, 4, (select id from Model where name='linearsvr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('intercept_scaling', 'Intercept scaling', 'Useful only when the solver ''liblinear'' is used and self.fit_intercept is set to True. In this case, x becomes [x, self.intercept_scaling], i.e. a synthetic feature with constant value equal to intercept_scaling is appended to the instance vector. The intercept becomes intercept_scaling * synthetic_feature_weight.', false, false, 5, (select id from Model where name='linearsvr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('loss', 'Loss', 'Specifies the loss function. The epsilon-insensitive loss (standard SVR) is the L1 loss, while the squared epsilon-insensitive loss (squared_epsilon_insensitive) is the L2 loss.', false, false, 6, (select id from Model where name='linearsvr_regressor'));
