INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('passive_aggressive_regressor', (select id from ml_task_type where name='regression'),'The Passive Aggressive Regressor is a linear model from the scikit-learn library. It is an online learning algorithm particularly suitable for large-scale data and streaming data scenarios where the model is incrementally updated with new data points. The algorithm derives its name from its approach to updating the model''s weights: it is "passive" when the current model''s prediction error is within a specified margin (controlled by the epsilon parameter), and "aggressive" when the prediction error exceeds this margin. The aggressiveness of the weight updates is controlled by a regularization parameter, which balances the trade-off between model stability and adaptability to new data. The Passive Aggressive Regressor is computationally efficient and can handle high-dimensional feature spaces, making it a valuable choice for various regression tasks, such as predicting numerical values in time-series data, forecasting sales, or estimating user ratings in recommendation systems.', 'Passive Aggressive Regressor', (select id from model_structure_type where name='base'), '{Efficient for large-scale learning tasks,Suitable for online learning and streaming data,Can handle high-dimensional data,Supports early stopping to prevent overfitting}', '{Sensitive to feature scaling,Requires tuning of hyperparameters,May not perform well on small datasets}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from model_type where name='Linear Model'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('C', 'C', 'Controls the inverse of regularization strength, with smaller values resulting in stronger regularization. Regularization helps prevent overfitting by penalizing large weights.', true, false, 1, (select id from Model where name='passive_aggressive_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('early_stopping', 'Early stopping', 'Determines if early stopping should be used to halt training when the validation score is not improving, preventing overfitting and reducing training time.', false, false, 2, (select id from Model where name='passive_aggressive_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('epsilon', 'Epsilon', 'Determines the threshold for the loss function, below which the model will not be updated. This balances the model''s sensitivity to small errors and its robustness to noise.', false, false, 3, (select id from Model where name='passive_aggressive_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Indicates if an intercept should be calculated for the model.', false, false, 4, (select id from Model where name='passive_aggressive_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('loss', 'Loss', 'Specifies the loss function to be optimized during training.', true, false, 5, (select id from Model where name='passive_aggressive_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', 'Sets the maximum number of iterations for the solver to converge, controlling the maximum training time.', true, false, 6, (select id from Model where name='passive_aggressive_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_iter_no_change', 'Maximum number of iterations with no change', 'Defines the maximum number of epochs without improvement in the validation score before stopping. Only effective when the solver is ''sgd'' or ''adam''.', false, false, 7, (select id from Model where name='passive_aggressive_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('shuffle', 'Shuffle', 'Determines if samples should be shuffled in each iteration, which can help avoid getting stuck in local minima.', false, false, 8, (select id from Model where name='passive_aggressive_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Controls the stopping criterion in iterative algorithms, specifying the minimum improvement in the objective function or loss between consecutive iterations required for the algorithm to continue training.', true, false, 9, (select id from Model where name='passive_aggressive_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('validation_fraction', 'Validation fraction', 'Specifies the proportion of training data to be set aside as a validation set for early stopping.', false, false, 10, (select id from Model where name='passive_aggressive_regressor'));
