INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('random_forest_regressor', (select id from ml_task_type where name='regression'),'The Random Forest Regressor is a versatile and powerful ensemble learning method from the scikit-learn library. It works by constructing multiple decision trees during training and outputting the mean prediction of the individual trees. This model is particularly effective for handling large datasets with high dimensionality and can automatically learn feature interactions.', 'Random Forest Regressor', (select id from model_structure_type where name='base'), '{Effective for large datasets and high-dimensional features,Automatically learns feature interactions,Reduces overfitting compared to single decision trees,Provides feature importance scores,Can handle missing data and requires minimal data preprocessing}', '{Can be computationally expensive due to the large number of trees,Less interpretable than single decision trees,Slower prediction time compared to some other models,May not perform well on very small datasets or with very noisy data}', true, (select id from model_ensemble_type where name='forest'),(select id from model_family_type where name='tree'), false, (select id from model_type where name='Tree-Based Model'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='random_forest_regressor'),(select id from model_group_type where name='advanced'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('bootstrap', 'Bootstrap', 'Indicates if bootstrap samples are used when building trees. If set to False, the entire dataset is used to build each tree, which may lead to overfitting.', false, false, 1, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('ccp_alpha', 'Cost-Complexity Pruning alpha', 'The complexity parameter for Minimal Cost-Complexity Pruning, which helps prevent overfitting by pruning the tree. Larger values of alpha result in more aggressive pruning. By default, no pruning is performed.', false, false, 2, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('criterion', 'Criterion', 'The function used to measure the quality of a split in a decision tree.', false, false, 3, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_depth', 'Maximum depth', 'The maximum depth allowed for each tree, which helps prevent overfitting by limiting complexity.', true, false, 4, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_features', 'Maximum features', 'Specifies the maximum number of features to consider when making a split in each decision tree, introducing randomness and diversity among the trees to improve the model''s generalization ability. ', true, false, 5, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_leaf_nodes', 'Maximum number of nodes', 'The maximum number of leaf nodes allowed in each tree, grown in a best-first fashion. Limits the number of leaf nodes in each decision tree, controlling the tree''s complexity and helping to prevent overfitting.', false, false, 6, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_samples', 'Maximum samples', 'The number of samples randomly drawn from the input data to train each base estimator.', false, false, 7, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_impurity_decrease', 'Minimum impurity decrease', 'The minimum decrease in impurity required for a node to be split. Helps prevent overfitting by controlling tree growth.', false, false, 8, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_leaf', 'Minimum samples per leaf', 'The minimum number of samples required for a node to be considered a leaf. This parameter helps prevent overfitting by ensuring that leaves have a sufficient number of samples.', false, false, 9, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_split', 'Minimum sample split', 'The minimum number of samples required to split an internal node, which helps control the growth of the tree and prevent overfitting.', false, false, 10, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_weight_fraction_leaf', 'Minimum weighted sum per leaf', 'The minimum weighted fraction of the total sample weights required for a node to be considered a leaf. By default, all samples have equal weight.', false, false, 11, (select id from Model where name='random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_estimators', 'Number of estimators', 'The number of decision trees in the ensemble, which affects the model''s performance and complexity.', true, false, 12, (select id from Model where name='random_forest_regressor'));
