INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('ridge_regressor', (select id from ml_task_type where name='regression'),'The Ridge Regressor is a type of linear regression model that incorporates L2 regularization to penalize large coefficients in the predictive variables. By adding a squared magnitude term of the coefficients in the loss function, Ridge regression discourages overly complex models, thereby reducing overfitting. It is particularly useful in scenarios where the number of features is large compared to the number of observations or when features are correlated, which can lead to multicollinearity issues in standard linear regression.', 'Ridge Regressor', (select id from model_structure_type where name='base'), '{Prevention of Overfitting: Ridge Regression helps prevent overfitting by adding a penalty term to the loss function, encouraging the model to keep the weight of each feature as small as possible. This makes it more robust when faced with irrelevant or highly correlated features.,Stable Solutions in High-Dimensional Space: Ridge Regression performs well even when the number of features is greater than the number of observations, providing a stable solution where ordinary least squares would fail.,Handles Multicollinearity: Ridge Regression deals effectively with multicollinearity (correlation between predictor variables) by distributing the coefficients among them. This makes it useful in applications where features are correlated, as it provides a more stable and robust estimate.}', '{No Feature Selection: Unlike methods such as Lasso or Elastic Net, Ridge Regression does not set any coefficients to zero, making all features part of the final model. This can make the model less interpretable when there are many irrelevant features.,Requires Hyperparameter Tuning: The strength of the regularization is controlled by a hyperparameter that needs to be tuned, adding to the complexity and computational cost of model development.,Sensitive to Feature Scaling: Just like Elastic Net, Ridge Regression is sensitive to the scale of input features. Therefore, feature scaling is often necessary as a preprocessing step to ensure that all features are treated equally by the regularization term.}', true, (select id from model_ensemble_type where name='null'),(select id from model_family_type where name='null'), false, (select id from model_type where name='Linear Model'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('alpha', 'Alpha', 'Constant that multiplies the L2 term, controlling regularization strength.', true, false, 1, (select id from Model where name='ridge_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Whether to calculate the intercept for this model. If set to False, no intercept will be used in calculations (i.e. data is expected to be centered).', false, false, 2, (select id from Model where name='ridge_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', '    Maximum number of iterations taken for the solvers to converge.', true, false, 3, (select id from Model where name='ridge_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('positive', 'Positive', 'When set to True, forces the coefficients to be positive.', false, false, 4, (select id from Model where name='ridge_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Maximum norm of the residual.', true, false, 5, (select id from Model where name='ridge_regressor'));
