INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('sgd_regressor', (select id from ml_task_type where name='regression'),'Stochastic Gradient Descent Regressor is a linear regression model with stochastic gradient descent (SGD) training. The gradient of the loss is estimated each sample at a time and the model is updated along the way with a decreasing strength schedule.', 'Stochastic Gradient Descent Regressor', (select id from model_structure_type where name='base'), '{It is computationally efficient,It has fast convergence for larger datasets}', '{It is not stable}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from model_type where name='Linear Model'));
