INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('average', 'Average', 'When set to True, computes the averaged SGD weights accross all updates and stores the result in the coef_ attribute.', false, false, 2, (select id from Model where name='sgd_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('early_stopping', 'Early stopping', 'Whether to use early stopping to terminate training when validation score is not improving.', false, false, 3, (select id from Model where name='sgd_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('epsilon', 'Epsilon', 'Value for numerical stability in adam. Only used when solver=''adam''.', false, false, 4, (select id from Model where name='sgd_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('eta0', 'Eta0', 'The initial learning rate for the ''constant'', ''invscaling'' or ''adaptive'' schedules.', false, false, 5, (select id from Model where name='sgd_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Whether to calculate the intercept for this model. If set to False, no intercept will be used in calculations (i.e. data is expected to be centered).', false, false, 6, (select id from Model where name='sgd_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('l1_ratio', 'L1 ratio', 'The Elastic-Net mixing parameter, with 0 <= l1_ratio <= 1.', true, false, 7, (select id from Model where name='sgd_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning rate', 'Step size shrinkage used in update to prevents overfitting. After each boosting step, we can directly get the weights of new features, and eta shrinks the feature weights to make the boosting process more conservative.', false, false, 8, (select id from Model where name='sgd_regressor'));
