INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('intelex_linear_regressor', (select id from ml_task_type where name='regression'),'The Linear Regressor is a fundamental statistical model that aims to establish a linear relationship between a set of input features and a continuous output variable. It is simple, interpretable, and computationally efficient, making it a good baseline model for many predictive tasks. The method seeks to fit a linear equation to observed data by minimizing the sum of the squared differences between the observed outcomes and the outcomes predicted by the model.', 'Intelex Linear Regressor', (select id from model_structure_type where name='base'), '{Interpretability: One of the main advantages of Linear Regression is its high interpretability. The coefficients of the model directly indicate the impact of each feature on the target variable, making it easy to explain the model''s decisions.,Low Computational Cost: Linear Regression is computationally inexpensive to train and predict, making it highly scalable for datasets with a large number of samples and features.,Fast to Implement and Train: Due to its simplicity and the availability of analytical solutions, a Linear Regressor can be quickly implemented and trained, serving as a useful baseline model in many machine learning projects.}', '{Prone to Overfitting with High-Dimensional Data: In cases where the number of features is greater than the number of observations, or when features are highly correlated, Linear Regression is susceptible to overfitting.,Assumes Linear Relationship: Linear Regression assumes that the relationship between the features and the target variable is linear. This assumption may not hold for complex, real-world data sets where relationships can be non-linear.,Sensitive to Outliers: The model is sensitive to outliers in the data, which can disproportionately affect the slope of the regression line and, consequently, the predictions.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from model_type where name='Linear Model'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Determines whether to include an intercept term in the linear regression model. If set to True, the model will calculate the intercept; if set to False, the model assumes that the data is centered and will not use an intercept in calculations.', true, false, 1, (select id from Model where name='intelex_linear_regressor'));
INSERT INTO rel_model__incompatible_metrics(model_id, metric_id) VALUES ((select id from model where name='intelex_linear_regressor'), (select id from metric where name='classification-log-loss'));
INSERT INTO rel_model__incompatible_metrics(model_id, metric_id) VALUES ((select id from model where name='intelex_linear_regressor'), (select id from metric where name='classification-roc'));
INSERT INTO parameter_type_definition(parameter_id, parameter_type_id, parameter_distribution_type_id, ordering) VALUES ((select id from parameter where name='fit_intercept' and model_id=(select id from model where name='intelex_linear_regressor')), (select id from parameter_type where name='boolean'), (select id from parameter_distribution_type where name='uniform'), 0);
INSERT INTO boolean_parameter(parameter_type_definition_id, default_value) VALUES ((select id from parameter_type_definition where parameter_id=(select id from parameter where name='fit_intercept' and model_id=(select id from model where name='intelex_linear_regressor') and parameter_type_id=(select id from parameter_type where name='boolean'))), true);
INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('intelex_random_forest_regressor', (select id from ml_task_type where name='regression'),'The Random Forest Regressor, powered by Intel oneDAL, is a versatile and powerful ensemble learning method. It works by constructing multiple decision trees during training and outputting the mean prediction of the individual trees. This model is particularly effective for handling large datasets with high dimensionality and can automatically learn feature interactions. Intel''s oneDAL significantly improves the performance of this model, making it suitable for applications that demand high performance.', 'Intelex Random Forest Regressor', (select id from model_structure_type where name='base'), '{Effective for large datasets and high-dimensional features,Automatically learns feature interactions,Reduces overfitting compared to single decision trees,Provides feature importance scores,Can handle missing data and requires minimal data preprocessing,Leverages Intel oneDAL for high-performance and scalability on Intel hardware}', '{Can be computationally expensive due to the large number of trees,Less interpretable than single decision trees,Slower prediction time compared to some other models,May not perform well on very small datasets or with very noisy data}', true, (select id from model_ensemble_type where name='forest'),(select id from model_family_type where name='tree'), false, (select id from model_type where name='Tree-Based Model'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('bootstrap', 'Bootstrap', 'Indicates if bootstrap samples are used when building trees. If set to False, the entire dataset is used to build each tree, which may lead to overfitting.', false, false, 1, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('ccp_alpha', 'Cost-Complexity Pruning alpha', 'The complexity parameter for Minimal Cost-Complexity Pruning, which helps prevent overfitting by pruning the tree. Larger values of alpha result in more aggressive pruning. By default, no pruning is performed.', false, false, 2, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('criterion', 'Criterion', 'The function used to measure the quality of a split in a decision tree.', false, false, 3, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_depth', 'Maximum depth', 'The maximum depth allowed for each tree, which helps prevent overfitting by limiting complexity.', true, false, 4, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_features', 'Maximum features', 'Specifies the maximum number of features to consider when making a split in each decision tree, introducing randomness and diversity among the trees to improve the model''s generalization ability. ', true, false, 5, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_leaf_nodes', 'Maximum number of nodes', 'The maximum number of leaf nodes allowed in each tree, grown in a best-first fashion. Limits the number of leaf nodes in each decision tree, controlling the tree''s complexity and helping to prevent overfitting.', false, false, 6, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_samples', 'Maximum samples', 'The number of samples randomly drawn from the input data to train each base estimator.', false, false, 7, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_impurity_decrease', 'Minimum impurity decrease', 'The minimum decrease in impurity required for a node to be split. Helps prevent overfitting by controlling tree growth.', false, false, 8, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_leaf', 'Minimum samples per leaf', 'The minimum number of samples required for a node to be considered a leaf. This parameter helps prevent overfitting by ensuring that leaves have a sufficient number of samples.', false, false, 9, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_split', 'Minimum sample split', 'The minimum number of samples required to split an internal node, which helps control the growth of the tree and prevent overfitting.', false, false, 10, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_weight_fraction_leaf', 'Minimum weighted sum per leaf', 'The minimum weighted fraction of the total sample weights required for a node to be considered a leaf. By default, all samples have equal weight.', false, false, 11, (select id from Model where name='intelex_random_forest_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_estimators', 'Number of estimators', 'The number of decision trees in the ensemble, which affects the model''s performance and complexity.', true, false, 12, (select id from Model where name='intelex_random_forest_regressor'));
