INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('intelex_svr_regressor', (select id from ml_task_type where name='regression'),'The SVR Regressor is a Support Vector Regression model from the scikit-learn library. It is an extension of the Support Vector Machine (SVM) algorithm for regression tasks. The model aims to find a function that approximates the relationship between input features and target values with a specified tolerance (epsilon). It uses different kernel functions to transform the input data into a higher-dimensional space, where a linear function is fitted to minimize the error between predicted and actual target values.', 'Intelex SVR Regressor', (select id from model_structure_type where name='base'), '{Effective in high-dimensional spaces.,Supports different kernel functions for versatile modeling.,Robust against overfitting, especially when using a high-dimensional feature space.}', '{Can be slow to train on large datasets.,Requires careful selection of kernel and hyperparameters.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='other'), false, (select id from model_type where name='Kernel Model'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('C', 'C', 'Inverse of the regularization strength. Controls the trade-off between achieving a low training error and a low testing error. A smaller value creates a wider margin, which may result in more training errors but better generalization to the test data.', true, false, 1, (select id from Model where name='intelex_svr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('coef0', 'Coefficient 0', 'Affects the shape of the decision boundary in ''poly'' and ''sigmoid'' kernels. It represents the independent term in the kernel function.', false, false, 2, (select id from Model where name='intelex_svr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('degree', 'Degree', 'Specifies the degree of the polynomial kernel function (''poly''). Higher degrees result in more complex decision boundaries. This parameter is ignored by all other kernels.', false, false, 3, (select id from Model where name='intelex_svr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('epsilon', 'Epsilon', 'Defines the margin of tolerance within which no penalty is given to errors. It determines the width of the epsilon-insensitive zone used to fit the training data.', false, false, 4, (select id from Model where name='intelex_svr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('kernel', 'Kernel', 'Determines the kernel function used in the algorithm. The kernel function transforms the input data into a higher-dimensional space where a linear function is fitted.', true, false, 5, (select id from Model where name='intelex_svr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', 'Sets the maximum number of iterations for the solver to converge. Early stopping may result in a suboptimal solution.', true, false, 6, (select id from Model where name='intelex_svr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('shrinking', 'Shrinking', 'Indicates whether to use the shrinking heuristic, which is a technique used to remove some of the constraints in the optimization problem to speed up training.', false, false, 7, (select id from Model where name='intelex_svr_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Specifies the tolerance for stopping criterion. The solver stops when the change in the residual is smaller than this value.', true, false, 8, (select id from Model where name='intelex_svr_regressor'));
