INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('lightgbm_regressor', (select id from ml_task_type where name='regression'),'The LightGBM Regressor is a gradient boosting framework based on decision trees from the LightGBM library. It uses a novel technique called Gradient-based One-Side Sampling (GOSS) to filter out the data instances for finding a split value, and Exclusive Feature Bundling (EFB) to reduce the number of features during training. This results in a faster training process and lower memory usage while maintaining high accuracy.', 'LightGBM Regressor', (select id from model_structure_type where name='base'), '{Faster training speed and lower memory usage compared to other gradient boosting frameworks.,High accuracy and good generalization performance.,Supports parallel and GPU learning.,Handles large-scale data and high-dimensional features well.}', '{Requires careful tuning of hyperparameters for optimal performance.,Less interpretable than simpler models like linear regression.,Not as robust to noise and outliers as some other models.}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='tree'), false, (select id from model_type where name='Tree-Based Model'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='lightgbm_regressor'),(select id from model_group_type where name='fast'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='lightgbm_regressor'),(select id from model_group_type where name='explainable'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='lightgbm_regressor'),(select id from model_group_type where name='advanced'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('boosting_type', 'Boosting type', 'Specifies the type of boosting algorithm to use, which determines how the model combines weak learners to form a strong learner.', false, false, 1, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('colsample_bytree', 'Column subsample ratio by tree', 'The fraction of features to select for each tree, which helps in reducing overfitting and improving training speed.', false, false, 2, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning rate', 'The shrinkage factor applied to the weights of new features after each boosting step, which helps prevent overfitting.', false, false, 3, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_depth', 'Maximum depth', 'The maximum depth of each decision tree, which controls the complexity of the model and prevents overfitting.', true, false, 4, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_child_samples', 'Minimum childs per sample', 'The minimum number of samples required in a leaf node, which helps prevent overfitting by controlling tree growth.', false, false, 5, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_child_weight', 'Minimum child weight', 'The minimum sum of instance weights (hessian) required in a child node, which affects the tree structure and prevents overfitting.', false, false, 6, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_split_gain', 'Minimal gain to split', 'The minimum gain required to perform a split, which helps control the complexity of the model.', false, false, 7, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_estimators', 'Number of estimators', 'The number of decision trees in the ensemble, which determines the overall complexity and capacity of the model.', true, false, 8, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('num_leaves', 'Number of leaves', 'The maximum number of leaves in a single decision tree, which controls the complexity of the tree and affects the model''s accuracy.', true, false, 9, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('reg_alpha', 'Regularization alpha', 'The L1 regularization term applied to the weights, which helps prevent overfitting by encouraging sparsity in the model.', false, false, 10, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('reg_lambda', 'Regularization lambda', 'The L2 regularization term applied to the weights, which helps prevent overfitting by penalizing large weights.', false, false, 11, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('subsample', 'Subsample', 'The fraction of training instances to use for each boosting iteration, which helps prevent overfitting and improves training speed.', false, false, 12, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('subsample_for_bin', 'Subsamples to construct bin', 'The number of samples used to construct discrete bins for continuous features, which affects the speed and memory usage of the model.', false, false, 13, (select id from Model where name='lightgbm_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('subsample_freq', 'Subsample frequency', 'The frequency at which subsampling occurs during the boosting process, which helps control overfitting and training speed.', false, false, 14, (select id from Model where name='lightgbm_regressor'));
