INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('fista_regressor', (select id from ml_task_type where name='regression'),'An estimator that employs the Fast Iterative Shrinkage-Thresholding Algorithm (FISTA) for training linear regression models. Designed for rapid convergence, FISTA is particularly advantageous for tackling large-scale and high-dimensional problems. The algorithm promotes sparse solutions, making it memory-efficient. It is well-suited for convex optimization tasks and offers flexibility in terms of regularization techniques.', 'Fast Iterative Shrinkage/Thresholding Regressor', (select id from model_structure_type where name='base'), '{Rapid Convergence: FISTA is designed for fast convergence, making it highly suitable for large and high-dimensional datasets.,Promotes Sparse Solutions: The algorithm encourages sparsity in the feature coefficients, which is advantageous in high-dimensional scenarios where feature selection is essential.,Memory-Efficient: Unlike some other optimization algorithms, FISTA does not require the storage of large intermediate matrices, making it resource-efficient.}', '{Hyperparameter Sensitivity: The performance of the FISTA Regressor can be sensitive to the choice of hyperparameters, requiring careful tuning for optimal results.,Numerical Instabilities: Similar to its classifier counterpart, the FISTA Regressor may suffer from numerical instabilities, which could impact its performance and reliability.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from model_type where name='Gradient Model'));
