INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('eta', 'Eta', 'Decrease factor for line-search procedure.', false, false, 3, (select id from Model where name='fista_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', 'Maximum number of iterations to perform.', false, false, 4, (select id from Model where name='fista_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_steps', 'Maximum number of steps', 'Maximum number of steps to use during the line search.', false, false, 5, (select id from Model where name='fista_regressor'));
