INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('cd_regressor', (select id from ml_task_type where name='regression'),'The Coordinate Descent Regressor is a machine learning algorithm designed to optimize linear regression models through (block) coordinate descent methods. It is particularly well-suited for large-scale and sparse datasets.', 'Coordinate Descent Regressor', (select id from model_structure_type where name='base'), '{Scalable to Large Datasets: The algorithm is designed to efficiently handle large volumes of data, making it suitable for applications with massive datasets.,Efficient Handling of Sparse Data: The Coordinate Descent Regressor can effectively manage sparse datasets, optimizing computational resources and potentially improving model performance.,Fine-Grained Control: The model offers various hyperparameters that provide fine-grained control over the optimization process, allowing for customized model tuning.}', '{Sensitive to Feature Scaling: Similar to its classifier counterpart, the Coordinate Descent Regressor may also be sensitive to the scaling of features, requiring pre-processing steps.,Limited to Linear Relationships: The model is primarily designed for linear regression tasks, making it less suitable for capturing complex, non-linear relationships in the data.,Hyperparameter Tuning Required: The performance of the model may be highly dependent on the appropriate tuning of hyperparameters, adding to the complexity and time required for model development.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from model_type where name='Gradient Model'));
