INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, model_type_id) VALUES ('catboost_regressor', (select id from ml_task_type where name='regression'),'The CatBoost Regressor is an implementation of gradient boosting for decision trees, specifically designed to handle categorical features effectively. CatBoost stands for ''Categorical Boosting'' and is optimized to reduce overfitting and improve generalization. The model is known for its robustness and high performance in a variety of data settings, including imbalanced and sparse datasets. It incorporates multiple techniques like ordered boosting and oblivious trees to improve speed and predictive accuracy.', 'CatBoost Regressor', (select id from model_structure_type where name='base'), '{Handling of Categorical Features: One of the standout features of CatBoost is its native ability to handle categorical variables, removing the need for prior encoding and thereby preventing data leakage and dimensionality increase.,Robust to Overfitting: CatBoost incorporates built-in mechanisms to prevent overfitting, making it more robust for small datasets or datasets where the number of features is high compared to the number of samples.,High Performance: CatBoost is often cited for its superior performance in terms of predictive accuracy, outperforming other gradient boosting and tree-based methods in various benchmarks.}', '{Computational Complexity: CatBoost can be computationally intensive and may require longer training times compared to simpler models, especially on large datasets.,Hyperparameter Tuning: While CatBoost is known for good ''out-of-the-box'' performance, fine-tuning its numerous hyperparameters for optimal performance can be time-consuming and complex.,Interpretability: Although it provides some tools for interpretation like feature importances, CatBoost models are generally more difficult to interpret compared to linear models due to their ensemble nature.}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='other'), false, (select id from model_type where name='Tree-Based Model'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='catboost_regressor'),(select id from model_group_type where name='fast'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='catboost_regressor'),(select id from model_group_type where name='explainable'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='catboost_regressor'),(select id from model_group_type where name='advanced'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('allow_const_label', 'Allow const label', 'Allows training with datasets that have equal label values for all objects.', false, false, 1, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('approx_on_full_history', 'Approximation on full history', 'Determines whether approximated values are calculated using all preceding rows in the fold or only a fraction of them.', false, false, 2, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('bagging_temperature', 'Bagging temperature', 'Controls the intensity of Bayesian bagging, with higher values resulting in more aggressive bagging.', false, false, 3, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('boost_from_average', 'Boost from average', 'Initializes approximated values with the best constant value for the specified loss function.', false, false, 4, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('boosting_type', 'Boosting type', 'Specifies the boosting scheme, either ''Ordered'' for better quality or ''Plain'' for classic gradient boosting.', false, false, 5, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('bootstrap_type', 'Bootstrap type', 'Determines the method used for sampling the data during the training process to create a diverse ensemble of weak learners.', false, false, 6, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('counter_calc_method', 'Counter calc method', 'Specifies the method used for calculating counters (statistics-based encodings) for categorical features, which generates new features enabling better capture of the relationship between categorical features and the target variable.', false, false, 7, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('depth', 'Depth', 'Sets the maximum depth of the decision trees in the ensemble.', true, false, 8, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('feature_border_type', 'Feature border type', 'Determines the quantization mode for numerical features.', false, false, 9, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fold_len_multiplier', 'Fold length multiplier', 'Adjusts the length of folds by a specified coefficient.', false, false, 10, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fold_permutation_block', 'Fold permutation block', 'Sets the size of blocks for grouping objects in the dataset before random permutations.', false, false, 11, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('has_time', 'Has time', 'Uses the order of objects in the input data without performing random permutations during certain stages.', false, false, 12, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('iterations', 'Iterations', 'Sets the number of iterations for the model.', true, false, 13, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('l2_leaf_reg', 'L2 regularization coefficient', 'Specifies the coefficient for the L2 regularization term of the cost function.', true, false, 14, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('leaf_estimation_backtracking', 'Leaf estimation backtracking', 'Determines the backtracking behavior when leaf_estimation_iterations is greater than 1.', false, false, 15, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning rate', 'Sets the step size shrinkage to prevent overfitting during the boosting process.', false, false, 16, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_ctr_complexity', 'Maximum complexity', 'The maximum number of categorical features that can be combined to generate numerical features during the training process.', false, false, 17, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('model_shrink_rate', 'Model shrink rate', 'Enables model shrinkage at the start of each iteration, which reduces the influence of the most recently added weak learners and helps prevent overfitting.', false, false, 18, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('model_size_reg', 'Model size regularization coefficient', 'Influences the model size when training data contains categorical features.', false, false, 19, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('nan_mode', 'NaN mode', 'Specifies the method for processing missing values in the input dataset.', false, false, 20, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('od_type', 'Overfitting detector type', 'Sets the type of overfitting detector to use.', false, false, 21, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('od_wait', 'Overfitting detector wait', 'Determines the number of iterations to continue training after the iteration with the optimal metric value.', false, false, 22, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('random_strength', 'Random strength', 'Sets the amount of randomness used for scoring splits during tree structure selection to avoid overfitting.', false, false, 23, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('rsm', 'RSM', 'Specifies the percentage of features to use at each split selection with random subspace method.', true, false, 24, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('score_function', 'Score function', 'Defines the score type used to select the next split during tree construction.', false, false, 25, (select id from Model where name='catboost_regressor'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('subsample', 'Subsample', 'Determines the fraction of the training dataset randomly sampled without replacement for training each weak learner, introducing diversity and reducing overfitting.', false, false, 26, (select id from Model where name='catboost_regressor'));
